function LoadArenaData()
    ArenaConfig = LoadTable(ArenaData_Path)
    if ArenaConfig == 0 then
        rfalse("LoadArenaConfig Faile")
    end
    --rfalse("LoadArenaData = "..)
end

function SaveArenaData()
    if ArenaConfig == nil or ArenaConfig == {} then
        return
    end

    local isave = SaveTable(ArenaData_Path,ArenaConfig)
     if isave == 0 then
        rfalse("SaveArenaData Faile")
     end
end


function ArenaConfigInit()
    if ArenaConfig == nil then
        ArenaConfig = {}
    end
    LoadArenaData()
end

